      .content-container {
        display: flex;
        color: white;
        padding: 40px;
        width: 100%;
        height: 100%;
        flex-direction: column;
      }

      .title,
      .sub-title {
        color: #fd7900;
      }

      .title {
        font-size: 65px;
        font-weight: 700;
        line-height: 105px;
        letter-spacing: 0.05em;
        text-align: center;
      }

      .sub-title {
        text-align: center;
        font-weight: 700;
        font-size: 32px;
        line-height: 48px;
      }

      .users {
        display: flex;
        align-items: center;
        gap: 130px;
        justify-content: center;
      }

      .user {
        display: flex;
        align-items: center;
        flex-direction: column;
        position: relative;
      }

      .user-name-container {
        height: 70px;
      }

      .user-name-box {
        width: 100%;
        top: 0;
        position: absolute;
        display: grid;
        place-items: center;
      }

      .user-name {
        font-style: normal;
        font-weight: 800;
        font-size: 40px;
        line-height: 40px;
        color: #ffbf00;
        text-align: center;
      }

      .user-image {
        position: relative;
        width: 100%;
        height: 100%;
      }

      .image {
        border: 5px solid #fd7900;
        position: absolute;
        top: 42px;
        left: 42px;
        border-radius: 50%;
        width: 300px;
        height: 300px;
        background-position: center;
        background-size: cover;
        background-repeat: no-repeat;
      }

      .heart {
        padding-top: 35px;
      }

      .text-curve {
        font-family: "Roboto Mono", monospace;
        font-style: normal;
        font-weight: 700;
        font-size: 32px;
        line-height: 32px;
        letter-spacing: 4.1px;
        opacity: 0.7;
      }

      .blockhain {
        padding: 10px 80px;
        padding-bottom: 20px;
        display: flex;
        gap: 400px;
        position: relative;
      }

      .stamp {
        position: absolute;
        left: 40%;
        top: 15px;
      }

      .stamp-code {
        position: absolute;
        top: 10px;
        left: 11px;
      }

      .stamp-curve {
        font-family: "Roboto Mono", monospace;
        font-style: normal;
        font-weight: 700;
        font-size: 10.5px;
        line-height: 13px;
        letter-spacing: 2.25px;
      }

      .section {
        display: flex;
        flex-direction: column;
      }

      .section-info {
        display: flex;
        gap: 5px;
      }

      .section-name,
      .section-data {
        font-size: 32px;
        font-weight: 700;
        line-height: 48px;
      }

      .section-name {
        color: #fd7900;
      }

      .section-data {
        color: #ffbf00;
      }

      .stamp-hearts {
        position: absolute;
        top: 46px;
        left: 47px;
      }

      .stamp-logo {
        position: absolute;
        top: 33px;
        left: 33px;
      }

      .w3id {
        position: absolute;
        top: 10px;
        left: 47%;
        font-size: 24px;
        font-weight: 600;
        line-height: 36px;
        text-align: center;
        color: #dea702;
        mix-blend-mode: normal;
      }
    </style>
    <title>Certificate</title>
  </head>
  <body>
    <div class="bg">
      <div class="certificate-bg">
        <div class="w3id">
          W3ID <span class="serial-number">[serial_number]</span>
        </div>
        <div class="container">
          <div class="heart-borders">
            <div class="content-container">
              <h1 class="title">Agreement of Love & Loyalty</h1>
              <h2 class="sub-title">between</h2>

              <div class="users">
                <div class="user">
                  <div class="user-name-container"></div>
                  <div class="user-name-box">
                    <div class="user-name">[name1]</div>
                  </div>
                  <div class="user-image">
                    <div
                      class="image"
                      style="
                        background-image: url(https://images.unsplash.com/photo-1652813260407-670f9ec7de0c?crop=entropy&cs=tinysrgb&fm=jpg&ixlib=rb-1.2.1&q=80&raw_url=true&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=687);
                      "
                    ></div>
                    <div class="user-code">
                      <svg width="380" height="380">
                        <path
                          id="curved"
                          fill="transparent"
                          d=" 
                          M 30, 190
                          a 150, 150 0 1,1 320,0
                          a 150, 150 0 1,1 -320,0
                        "
                        />
                        <text>
                          <textPath
                            xlink:href="#curved"
                            class="text-curve"
                            fill="#FD7900
                            "
                          >
                            [address1]
                          </textPath>
                        </text>
                      </svg>
                    </div>
                  </div>
                </div>
